Chi Bi Xia: Jue Zhan Tian Xia AKA RED CLIFF II (2009) Retail NL Subs


[img]http://img26.imageshack.us/img26/6999/redcliff2s.jpg[/img]


China
Actie / Avontuur
136 minuten


geregisseerd door John Woo
met Tony Leung Chiu Wai, Takeshi Kaneshiro en Wei Zhao


Red Cliff 2 gaat verder waar Red Cliff stopte. Eerste minister Cao Cao overtuigde keizer Han een veldtocht te beginnen tegen de koninkrijken van Xu en Wu die tegen de verwachtingen in een verbond sloten. De twee machten zullen elkaar treffen in een gigantische veldslag bij Red Cliff.



